import React, { Component } from 'react';
import { BrowserRouter as Router, Redirect } from 'react-router-dom';
import { Route } from 'react-router';

import Main from '../../boilerplate';

// Company Routes
import AllCompany from './all.js';
import OneCompany from './one.js';

class CompanyRouter extends Component {
  render(){
    return (
      <Router>
        <Route component={ Main }/>
        <Route path="/company/" component={ AllCompany }/>
        <Route path="/company/:id" component={ OneCompany }/>
      </Router>
    );
  }
}

export default CompanyRouter
